    /// <summary>
    /// Data from the Unicode 7.0 Character Database useful for regular expressions over Unicode text.
    /// </summary>
    public static class Unicode7
    {
        #region Conversion to/from UTF32 encoding

        internal const int SURROGATE_MASK = 0xFC00;
        internal const int HI_SURR_MIN = 0xD800;
        internal const int HI_SURR_OFFSET = 0xD7C0;
        internal const int LO_SURR_MIN = 0xDC00;

        private const int UNICODE_MAX = 0x10FFFF;
        private const char REPLACEMENT = '\uFFFD';

        /// <summary>Converts the codepoint at a specified location in a UTF-16 string to an integer.</summary>
        /// <param name="text">The string, encoded in UTF-16.</param>
        /// <param name="pos">The position in <paramref name="text"/>.</param>
        /// <returns>The codepoint encoded at <paramref name="text"/>[<paramref name="pos"/>].</returns>
        public static int ToCodepoint(this string text, int pos)
        {
            if (pos == -1) return int.MaxValue;
            if (pos == text.Length) return int.MaxValue;

            int point = text[pos];
            switch (point & SURROGATE_MASK)
            {
                case HI_SURR_MIN:
                    if (pos + 1 < text.Length && (text[pos + 1] & SURROGATE_MASK) == LO_SURR_MIN)
                        point = ((point - HI_SURR_OFFSET) << 10) + text[pos + 1] - LO_SURR_MIN;
                    break;

                case LO_SURR_MIN:
                    if (pos > 0 && (text[pos - 1] & SURROGATE_MASK) == HI_SURR_MIN)
                        point = ((text[pos - 1] - HI_SURR_OFFSET) << 10) + point - LO_SURR_MIN;
                    break;
            }
            return point;
        }

        /// <summary>Finds the start of the next character in a UTF-16 string after a position.</summary>
        /// <param name="text">The string, encoded in UTF-16.</param>
        /// <param name="pos">The position in <paramref name="text"/>.</param>
        /// <returns>The position in <paramref name="text"/> where the character
        /// after <paramref name="pos"/> starts.</returns>
        public static void NextCodepoint(this string text, ref int pos)
        {
            if (pos + 1 < text.Length && (text[pos] & SURROGATE_MASK) == HI_SURR_MIN
                && (text[pos + 1] & SURROGATE_MASK) == LO_SURR_MIN) pos++;
            pos++;
        }

        /// <summary>Finds the start of the previous character in a UTF-16 string before a position.</summary>
        /// <param name="text">The string, encoded in UTF-16.</param>
        /// <param name="pos">The position in <paramref name="text"/>.</param>
        /// <returns>The position in <paramref name="text"/> where the character
        /// before <paramref name="pos"/> starts.</returns>
        public static void PrevCodepoint(this string text, ref int pos)
        {
            pos--;
            if (pos > 0 && (text[pos] & SURROGATE_MASK) == LO_SURR_MIN
                && (text[pos - 1] & SURROGATE_MASK) == HI_SURR_MIN) pos--;
        }

        /// <summary>Converts a UTF-32 codepoint to a UTF-16 string.</summary>
        /// <param name="codepoint">The codepoint.</param>
        /// <returns><paramref name="codepoint"/>, encoded in UTF-16.</returns>
        public static string ToUTF16String(this int codepoint)
        {
            if (codepoint > UNICODE_MAX)
                return REPLACEMENT.ToString();
            else if (codepoint > Char.MaxValue)
                return "" + (char)((codepoint >> 10) + HI_SURR_OFFSET)
                    + (char)((codepoint & 0x3FF) + LO_SURR_MIN);
            else
                return ((char)codepoint).ToString();
        }

        #endregion

        #region Property index data structure

        /// <summary>
        /// A read-only three-level table holding, in compressed form, a map of Unicode characters to property values.
        /// </summary>
        /// <typeparam name="TValue">The type of values for the property encoded in this table.</typeparam>
        struct PropertyIndex<TValue>
        {
            public const byte PAGE_BITS = 7;
            const int PAGE_SIZE = 1 << PAGE_BITS;

            byte[] top;
            byte[,] middle;
            TValue[,] bottom;

            public PropertyIndex(byte[] topLevel, byte[,] midLevel, TValue[,] pageLevel)
            {
                top = topLevel;
                middle = midLevel;
                bottom = pageLevel;
            }

            public TValue this[int codepoint]
            {
                get
                {
                    int i = codepoint >> 2* PAGE_BITS;
                    int j = (codepoint >> PAGE_BITS) & (PAGE_SIZE - 1);
                    int k = codepoint & (PAGE_SIZE - 1);
                    return bottom[middle[top[i], j], k];
                }
            }
        }

        #endregion

        #region Unicode blocks

        internal struct Range
        {
            public int Min;
            public int Max;
            public Range(int min, int max) { Min = min; Max = max; }
        }

        /// <summary>Searches the list of named blocks in Unicode 7.0. All defined aliases for blocks are recognized.</summary>
        /// <param name="name">A name for a block.</param>
        /// <returns>The <see cref="Range"/> of codepoints that is named <paramref name="name"/>,
        /// if there is one; otherwise null.</returns>
        internal static Range? FindBlock(string name)
        {
            string canonName = name.ToCanonPropertyValue();
            if (UNICODE_BLOCKS.ContainsKey(canonName))
                return UNICODE_BLOCKS[canonName];
            else
                return null;
        }

