        #region General categories for code points

        /// <summary>
        /// Returns the General Category code for a specified name. All defined aliases are recognized.
        /// </summary>
        /// <param name="name">A name for a general category in Unicode.</param>
        /// <returns>The <see cref="UnicodeCategory"/> value named <paramref name="name"/>,
        /// if there is one; otherwise null.</returns>
        public static UnicodeCategory? CategoryName(string name)
        {
            string canonName = name.ToCanonPropertyValue();
            if (CATEGORY_NAMES.ContainsKey(canonName))
                return CATEGORY_NAMES[canonName];
            else
                return null;
        }

        /// <summary>Returns the value of the General Category property for a Unicode codepoint.</summary>
        /// <param name="codepoint">The codepoint to be searched for.</param>
        /// <returns>The <see cref="UnicodeCategory"/> value defined for <paramref name="codepoint"/>.</returns>
        public static UnicodeCategory GetUnicodeCategory(this int codepoint)
        {
            if (codepoint < 0 || codepoint >= UNICODE_MAX) return UnicodeCategory.OtherNotAssigned;

            return (UnicodeCategory)CATEGORY_INDEX[codepoint];
        }

        /// <summary>Returns the 2-letter abbreviation for a General Category value.</summary>
        /// <param name="cat">The code for a <see cref="UnicodeCategory"/>.</param>
        /// <returns>The abbreviation.</returns>
        public static string Abbreviation(this UnicodeCategory cat) { return CATEGORY_ABBREVS[(int)cat]; }

