        /// <summary>Returns the Script code for a specified name. All defined aliases are recognized.</summary>
        /// <param name="name">A name for a script in Unicode.</param>
        /// <returns>The <see cref="Script"/> value named <paramref name="name"/>,
        /// if there is one; otherwise null.</returns>
        public static Script? ScriptName(string name)
        {
            string canonName = name.ToCanonPropertyValue();
            if (SCRIPT_NAMES.ContainsKey(canonName))
                return SCRIPT_NAMES[canonName];
            else
                return null;
        }

        /// <summary>Returns the 4-letter abbreviation for a Script value.</summary>
        /// <param name="scr">The code for a <see cref="Script"/>.</param>
        /// <returns>The abbreviation.</returns>
        public static string Abbreviation(this Script scr) { return SCRIPT_ABBREVS[(int)scr]; }

        /// <summary>Returns the value of the Script property for a Unicode codepoint.</summary>
        /// <param name="codepoint">The codepoint to be searched for.</param>
        /// <returns>The <see cref="Script"/> value defined for <paramref name="codepoint"/>.</returns>
        public static Script GetScript(this int codepoint)
        {
            if (codepoint < 0 || codepoint >= UNICODE_MAX) return Script.Unknown;

            return (Script)SCRIPT_INDEX[codepoint];
        }

        /// <summary>Indicates whether the value of the Script Extensions property for a Unicode codepoint
        /// contains a specifiied script.</summary>
        /// <param name="codepoint">The codepoint to be examined.</param>
        /// <param name="scriptID">The <see cref="Script"/> to be checked for.</param>
        /// <returns><c>true</c> if the Script Extensions property at <paramref name="codepoint"/>
        /// contains <paramref name="scriptID"/>, otherwise <c>false</c>.</returns>
        public static bool IsInExtendedScript(this int codepoint, Script scriptID)
        {
            if (codepoint < 0 || codepoint >= UNICODE_MAX) return false;

            byte[] scriptCodes = SCRIPT_EXTENSION_INDEX[codepoint];
            if (scriptCodes != null)
                return Array.FindIndex(scriptCodes, s => (Script)s == scriptID) >= 0;
            else
                return scriptID == codepoint.GetScript();
        }

