        #region Binary properties

        /// <summary>Codes representing the recognized properties.</summary>
        public enum Property : int
        {
            /// <summary>Matches any character.</summary>
            AnyChar = 0,
            /// <summary>Matches newline characters.</summary>
            Newline,
            /// <summary>Matches whitespace.</summary>
            Space,
            /// <summary>Matches printable characters.</summary>
            Graph,
            /// <summary>Matches word characters.</summary>
            Word,
            /// <summary>Matches alphabetic characters.</summary>
            Alpha,
            /// <summary>Matches cased characters.</summary>
            Cased,
            /// <summary>Matches uppercase characters.</summary>
            Upper,
            /// <summary>Matches lowercase characters.</summary>
            Lower,
            /// <summary>Matches ignorable characters.</summary>
            Ignorable,
            /// <summary>Matches defined noncharacter codepoints.</summary>
            NonChar,
            /// <summary>Matches when General Category = Letter.</summary>
            Letter,
            /// <summary>Matches when General Category = Mark.</summary>
            Mark,
            /// <summary>Matches when General Category = Separator.</summary>
            Separator,
            /// <summary>Matches when General Category = Symbol.</summary>
            Symbol,
            /// <summary>Matches when General Category = Number.</summary>
            Number,
            /// <summary>Matches when General Category = Punctuation.</summary>
            Punctuation,
            /// <summary>Matches when General Category = Other.</summary>
            Other,
            /// <summary>Matches when a position is the start of a string.</summary>
            TextBegin,
            /// <summary>Matches when a position is the end of a string.</summary>
            TextEnd,
            /// <summary>Matches when a position is the start of a line.</summary>
            LineBegin,
            /// <summary>Matches when a position is the end of a line.</summary>
            LineEnd,
            /// <summary>Matches when a position is a simple word boundary.</summary>
            SimpleWordBreak,
            /// <summary>Matches when a position is a default word boundary.</summary>
            DefaultWordBreak,
            /// <summary>Matches when General Category is a single <see cref="UnicodeCategory"/>.</summary>
            GenCategory,
            /// <summary>Matches when Script is a single <see cref="Unicode7.Script"/>.</summary>
            Script,
            /// <summary>Matches when Script Extensions contains a <see cref="Unicode7.Script"/>.</summary>
            ScriptExtension,
        }

        /// <summary>
        /// Strips whitespace, hyphens and underscores out of a string, and converts it to lowercase.
        /// This is the normal form for property names and values in the Unicode Character Database.
        /// </summary>
        /// <param name="name">A possible property name or value.</param>
        /// <returns><paramref name="name"/>, converted to normal form.</returns>
        internal static string ToCanonPropertyValue(this string name)
        {
            char[] spacers = 
            { ' ', '\u0009', '\u000A', '\u000B', '\u000C', '\u000D', '\u0085', '\u00A0',
                '\u1680', '\u2000', '\u2001', '\u2002', '\u2003', '\u2004', '\u2005', '\u2006',
                '\u2007', '\u2008', '\u2009', '\u200A', '\u2028', '\u2029', '\u202F', '\u205F',
                '\u3000', '-', '\u00AD', '\u058A', '\u1806', '\u2010', '\u2011', '\u2E17',
                '\u30FB', '\uFE63', '\uFF0D', '\uFF65', '_', '\u203F', '\u2040', '\u2054', 
                '\uFE33', '\uFE34', '\uFE4D', '\uFE4E', '\uFE4F', '\uFF3F', 
            };
            return String.Join("", name.Split(spacers)).ToLowerInvariant();
        }

        /// <summary>
        /// Returns the <see cref="Property"/> code for a specified name. All defined aliases are recognized.
        /// </summary>
        /// <param name="name">A name for a property in Unicode.</param>
        /// <returns>The <see cref="Property"/> code named <paramref name="name"/>,
        /// if there is one; otherwise null.</returns>
        public static Property? PropertyName(string name)
        {
            string canonName = name.ToCanonPropertyValue();
            if (PROPERTY_NAMES.ContainsKey(canonName))
                return PROPERTY_NAMES[canonName];
            else
                return null;
        }

        /// <summary>Returns the notation for a binary property.</summary>
        /// <param name="prop">The code for a <see cref="Property"/>.</param>
        /// <param name="passIf"></param>
        /// <returns>The abbreviation.</returns>
        public static string Abbreviation(this Property prop, bool passIf)
        {
            return PROPERTY_ABBREVS[passIf ? 0 : 1, (int)prop];
        }

        /// <summary>Indicates whether one property is a subset of another.</summary>
        /// <param name="left">The possible superset.</param>
        /// <param name="right">The possible subset.</param>
        /// <returns><c>true</c> if <paramref name="right"/> is a subset of <paramref name="left"/>,
        /// otherwise <c>false</c>.</returns>
        public static bool Contains(this Property left, Property right)
        {
            return CONTAINS_PROPERTIES[(byte)left][(byte)right];
        }

        /// <summary>Indicates whether a category is a subset of a property.</summary>
        /// <param name="prop">The possible superset.</param>
        /// <param name="cat">The possible subset.</param>
        /// <returns><c>true</c> if <paramref name="cat"/> is a subset of <paramref name="prop"/>,
        /// otherwise <c>false</c>.</returns>
        public static bool Contains(this Property prop, UnicodeCategory cat)
        {
            return CONTAINS_CATEGORIES[(byte)prop][(byte)cat];
        }

        /// <summary>Indicates whether two properties have no codepoints in common.</summary>
        /// <param name="left">The first property.</param>
        /// <param name="right">The second property.</param>
        /// <returns><c>true</c> if <paramref name="left"/> and <paramref name="right"/> are disjoint,
        /// otherwise <c>false</c>.</returns>
        public static bool DisjointWith(this Property left, Property right)
        {
            return !(CONTAINS_PROPERTIES[(byte)left][(byte)right] ||
                CONTAINS_PROPERTIES[(byte)right][(byte)left] || OVERLAPS_PROPERTIES[(byte)left][(byte)right]);
        }

        /// <summary>Indicates whether a property and a category have no codepoints in common.</summary>
        /// <param name="prop">The property.</param>
        /// <param name="cat">The general category.</param>
        /// <returns><c>true</c> if <paramref name="prop"/> and <paramref name="cat"/> are disjoint,
        /// otherwise <c>false</c>.</returns>
        public static bool DisjointWith(this Property prop, UnicodeCategory cat)
        {
            return !(CONTAINS_CATEGORIES[(byte)prop][(byte)cat] ||
                OVERLAPS_CATEGORIES[(byte)prop][(byte)cat]);
        }

        /// <summary>Indicates whether a codepoint belongs to a property.</summary>
        /// <param name="prop">The property.</param>
        /// <param name="codepoint">The codepoint.</param>
        /// <returns><c>true</c> if <paramref name="prop"/> is true at <paramref name="codepoint"/>,
        /// otherwise <c>false</c>.</returns>
        public static bool Contains(this Property prop, int codepoint)
        {
            switch (prop)
            {
                case Unicode7.Property.AnyChar: return true;
                case Unicode7.Property.Newline: return codepoint.IsNewline();
                case Unicode7.Property.Space: return codepoint.IsWhitespace();
                case Unicode7.Property.Graph: return codepoint.IsGraphCharacter();
                case Unicode7.Property.Word: return codepoint.IsWordCharacter();
                case Unicode7.Property.Alpha: return codepoint.IsAlphabetic();
                case Unicode7.Property.Upper: return codepoint.IsUppercase();
                case Unicode7.Property.Lower: return codepoint.IsLowercase();
                case Unicode7.Property.Ignorable: return codepoint.IsIgnorable();
                case Unicode7.Property.NonChar: return codepoint.IsNoncharacter();
                case Unicode7.Property.Letter: return codepoint.IsLetter();
                case Unicode7.Property.Cased: return codepoint.IsCased();
                case Unicode7.Property.Mark: return codepoint.IsMark();
                case Unicode7.Property.Separator: return codepoint.IsSeparator();
                case Unicode7.Property.Symbol: return codepoint.IsSymbol();
                case Unicode7.Property.Number: return codepoint.IsNumber();
                case Unicode7.Property.Punctuation: return codepoint.IsPunctuation();
                case Unicode7.Property.Other: return codepoint.IsOther();

                default: throw new InvalidOperationException(
                    String.Format("Not enough information to resolve {0}", prop));
            }
        }

        /// <summary>Indicates whether a position in a string satisfies a property.</summary>
        /// <param name="prop">The property.</param>
        /// <param name="text">The string, encoded in UTF-16.</param>
        /// <param name="pos">The position in <paramref name="text"/>.</param>
        /// <returns><c>true</c> if <paramref name="prop"/> is true at
        /// <paramref name="text"/>[<paramref name="pos"/>], otherwise <c>false</c>.</returns>
        public static bool Contains(this Property prop, string text, int pos)
        {
            switch (prop)
            {
                case Unicode7.Property.AnyChar: return pos < text.Length;
                case Unicode7.Property.Newline: return text.IsNewline(pos);
                case Unicode7.Property.Space: return text.IsWhitespace(pos);
                case Unicode7.Property.Graph: return text.IsGraphCharacter(pos);
                case Unicode7.Property.Word: return text.IsWordCharacter(pos);
                case Unicode7.Property.Alpha: return text.IsAlphabetic(pos);
                case Unicode7.Property.Upper: return text.IsUppercase(pos);
                case Unicode7.Property.Lower: return text.IsLowercase(pos);
                case Unicode7.Property.Ignorable: return text.IsIgnorable(pos);
                case Unicode7.Property.NonChar: return text.IsNoncharacter(pos);
                case Unicode7.Property.Letter: return text.IsLetter(pos);
                case Unicode7.Property.Cased: return text.IsCased(pos);
                case Unicode7.Property.Mark: return text.IsMark(pos);
                case Unicode7.Property.Separator: return text.IsSeparator(pos);
                case Unicode7.Property.Symbol: return text.IsSymbol(pos);
                case Unicode7.Property.Number: return text.IsNumber(pos);
                case Unicode7.Property.Punctuation: return text.IsPunctuation(pos);
                case Unicode7.Property.Other: return text.IsOther(pos);
                case Unicode7.Property.TextBegin: return pos == 0;
                case Unicode7.Property.TextEnd: return pos == text.Length;
                case Unicode7.Property.LineBegin: return text.IsLineBegin(pos);
                case Unicode7.Property.LineEnd: return text.IsLineEnd(pos);
                case Unicode7.Property.SimpleWordBreak: return text.SimpleWordBreak(pos);
                case Unicode7.Property.DefaultWordBreak: return text.DefaultWordBreak(pos);

                default: throw new InvalidOperationException(
                    String.Format("Not enough information to resolve {0}", prop));
            }
        }

        enum BinaryProps : byte { None, Alpha, Upper, Lower, Ignorable };

        static BinaryProps GetBinPropData(this int codepoint)
        {
            return (BinaryProps)BIN_PROP_INDEX[codepoint];
        }

        /// <summary>Indicates whether a codepoint separates lines. Implements \N.</summary>
        /// <param name="codepoint">The codepoint to be examined.</param>
        /// <returns><c>true</c> if <paramref name="codepoint"/> is in \N, otherwise false.</returns>
        public static bool IsNewline(this int codepoint)
        {
            return (codepoint >= 0xA && codepoint <= 0xD) ||
                (codepoint == 0x85) || (codepoint == 0x2028) || (codepoint == 0x2029);
        }

        /// <summary>Indicates whether a character at a position separates lines. Implements \N.</summary>
        /// <param name="text">The string, encoded in UTF-16.</param>
        /// <param name="pos">The position in <paramref name="text"/>.</param>
        /// <returns><c>true</c> if <paramref name="text"/>[<paramref name="pos"/>] is in \N, otherwise false.</returns>
        public static bool IsNewline(this string text, int pos)
        {
            int point = text.ToCodepoint(pos);
            return point != int.MaxValue && point.IsNewline();
        }

        /// <summary>Indicates whether a codepoint is white space. Implements \p{Space}.</summary>
        /// <param name="codepoint">The codepoint to be examined.</param>
        /// <returns><c>true</c> if <paramref name="codepoint"/> is in \p{Space}, otherwise false.</returns>
        public static bool IsWhitespace(this int codepoint)
        {
            if ((codepoint >= 0x9 && codepoint <= 0xD) || (codepoint == 0x85))
                return true;
            else
                return Property.Space.Contains(codepoint.GetUnicodeCategory());
        }

        /// <summary>Indicates whether a character at a position is white space. Implements \p{Space}.</summary>
        /// <param name="text">The string, encoded in UTF-16.</param>
        /// <param name="pos">The position in <paramref name="text"/>.</param>
        /// <returns><c>true</c> if <paramref name="text"/>[<paramref name="pos"/>] is in \p{Space}, otherwise false.</returns>
        public static bool IsWhitespace(this string text, int pos)
        {
            int point = text.ToCodepoint(pos);
            return point != int.MaxValue && point.IsWhitespace();
        }

        /// <summary>Indicates whether a codepoint is a printable character. Implements \p{Graph}.</summary>
        /// <param name="codepoint">The codepoint to be examined.</param>
        /// <returns><c>true</c> if <paramref name="codepoint"/> is in \p{Graph}, otherwise false.</returns>
        public static bool IsGraphCharacter(this int codepoint)
        {
            return Property.Graph.Contains(codepoint.GetUnicodeCategory());
        }

        /// <summary>Indicates whether a character at a position is a printable character. Implements \p{Graph}.</summary>
        /// <param name="text">The string, encoded in UTF-16.</param>
        /// <param name="pos">The position in <paramref name="text"/>.</param>
        /// <returns><c>true</c> if <paramref name="text"/>[<paramref name="pos"/>] is in \p{Graph}, otherwise false.</returns>
        public static bool IsGraphCharacter(this string text, int pos)
        {
            int point = text.ToCodepoint(pos);
            return point != int.MaxValue && point.IsGraphCharacter();
        }

        /// <summary>Indicates whether a codepoint is a word character. Implements \w.</summary>
        /// <remarks>\w == \p{Alpha} | \p{Nd} | \p{M} | \p{Pc} | \u200C | \u200D</remarks>
        /// <param name="codepoint">The codepoint to be examined.</param>
        /// <returns><c>true</c> if <paramref name="codepoint"/> is in \w, otherwise false.</returns>
        public static bool IsWordCharacter(this int codepoint)
        {
            if (codepoint == 0x200C || codepoint == 0x200D)
                return true;
            else if (Property.Word.Contains(codepoint.GetUnicodeCategory()))
                return true;
            else
            {
                BinaryProps binProp = codepoint.GetBinPropData();
                return binProp == BinaryProps.Upper || binProp == BinaryProps.Lower || binProp == BinaryProps.Alpha;
            }
        }

        /// <summary>Indicates whether a character at a position is a word character. Implements \w.</summary>
        /// <param name="text">The string, encoded in UTF-16.</param>
        /// <param name="pos">The position in <paramref name="text"/>.</param>
        /// <returns><c>true</c> if <paramref name="text"/>[<paramref name="pos"/>] is in \p{Graph}, otherwise false.</returns>
        public static bool IsWordCharacter(this string text, int pos)
        {
            int point = text.ToCodepoint(pos);
            return point != int.MaxValue && point.IsWordCharacter();
        }

        /// <summary>Indicates whether a codepoint is alphabetic. Implements \p{Alpha}.</summary>
        /// <param name="codepoint">The codepoint to be examined.</param>
        /// <returns><c>true</c> if <paramref name="codepoint"/> is in \p{Alpha}, otherwise false.</returns>
        public static bool IsAlphabetic(this int codepoint)
        {
            if (Property.Alpha.Contains(codepoint.GetUnicodeCategory()))
                return true;
            else
            {
                BinaryProps binProp = codepoint.GetBinPropData();
                return binProp == BinaryProps.Upper || binProp == BinaryProps.Lower || binProp == BinaryProps.Alpha;
            }
        }

        /// <summary>Indicates whether a character at a position is alphabetic. Implements \p{Alpha}.</summary>
        /// <param name="text">The string, encoded in UTF-16.</param>
        /// <param name="pos">The position in <paramref name="text"/>.</param>
        /// <returns><c>true</c> if <paramref name="text"/>[<paramref name="pos"/>] is in \p{Alpha}, otherwise false.</returns>
        public static bool IsAlphabetic(this string text, int pos)
        {
            int point = text.ToCodepoint(pos);
            return point != int.MaxValue && point.IsAlphabetic();
        }

        /// <summary>Indicates whether a codepoint is a cased character in Unicode. Implements \p{LC}.</summary>
        /// <param name="codepoint">The codepoint to be examined.</param>
        /// <returns><c>true</c> if <paramref name="codepoint"/> is in \p{LC}, otherwise false.</returns>
        public static bool IsCased(this int codepoint)
        {
            BinaryProps binProp = codepoint.GetBinPropData();
            return binProp == BinaryProps.Upper || binProp == BinaryProps.Lower ||
                Property.Cased.Contains(codepoint.GetUnicodeCategory());
        }

        /// <summary>Indicates whether a character at a position is a cased character in Unicode. Implements \p{LC}.</summary>
        /// <param name="text">The string, encoded in UTF-16.</param>
        /// <param name="pos">The position in <paramref name="text"/>.</param>
        /// <returns><c>true</c> if <paramref name="text"/>[<paramref name="pos"/>] is in \p{LC}, otherwise false.</returns>
        public static bool IsCased(this string text, int pos)
        {
            int point = text.ToCodepoint(pos);
            return point != int.MaxValue && point.IsCased();
        }

        /// <summary>Indicates whether a codepoint is an uppercase letter. Implements \p{Upper}.</summary>
        /// <remarks>\p{Upper} is a superset of \p{Lu}.</remarks>
        /// <param name="codepoint">The codepoint to be examined.</param>
        /// <returns><c>true</c> if <paramref name="codepoint"/> is in \p{Upper}, otherwise false.</returns>
        public static bool IsUppercase(this int codepoint)
        {
            return (codepoint.GetUnicodeCategory() == UnicodeCategory.UppercaseLetter) ||
                codepoint.GetBinPropData() == BinaryProps.Upper;
        }

        /// <summary>Indicates whether a character at a position is an uppercase letter. Implements \p{Upper}.</summary>
        /// <param name="text">The string, encoded in UTF-16.</param>
        /// <param name="pos">The position in <paramref name="text"/>.</param>
        /// <returns><c>true</c> if <paramref name="text"/>[<paramref name="pos"/>] is in \p{Upper}, otherwise false.</returns>
        public static bool IsUppercase(this string text, int pos)
        {
            int point = text.ToCodepoint(pos);
            return point != int.MaxValue && point.IsUppercase();
        }

        /// <summary>Indicates whether a codepoint is a lowercase letter. Implements \p{Lower}.</summary>
        /// <remarks>\p{Lower} is a superset of \p{Ll}.</remarks>
        /// <param name="codepoint">The codepoint to be examined.</param>
        /// <returns><c>true</c> if <paramref name="codepoint"/> is in \p{Lower}, otherwise false.</returns>
        public static bool IsLowercase(this int codepoint)
