        /// <summary>Indicates whether a position is the start of a line. Implements \b{a}.</summary>
        /// <param name="text">The string to be examined.</param>
        /// <param name="pos">A position in <paramref name="text"/>.</param>
        /// <returns><c>true</c> if <paramref name="pos"/> is just after a newline sequence
        /// in <paramref name="text"/>, otherwise false.</returns>
        public static bool IsLineBegin(this string text, int pos)
        {
            if (pos <= 0)
                return true;
            else if (pos >= text.Length)
                return false;
            else if (text[pos - 1] == 0xD)
                return text[pos] != 0xA;
            else
                return text.ToCodepoint(pos - 1).IsNewline();
        }

        /// <summary>Indicates whether a position is the end of a line. Implements \b{z}.</summary>
        /// <param name="text">The string to be examined.</param>
        /// <param name="pos">A position in <paramref name="text"/>.</param>
        /// <returns><c>true</c> if <paramref name="pos"/> is just before a newline sequence
        /// in <paramref name="text"/>, otherwise false.</returns>
        public static bool IsLineEnd(this string text, int pos)
        {
            if (pos < 0)
                return false;
            else if (pos == 0)
                return text.ToCodepoint(pos).IsNewline();
            else if (pos >= text.Length)
                return true;
            else if (text.ToCodepoint(pos) == 0xA)
                return text.ToCodepoint(pos - 1) != 0xD;
            else
                return text.ToCodepoint(pos).IsNewline();
        }

        /// <summary>Indicates whether a pos is the boundary of a word. Implements \b{w}.</summary>
        /// <remarks>In simple word boundary mode, \b matches between a character in \w and one in \W.</remarks>
        /// <param name="text">The string to be examined.</param>
        /// <param name="pos">A position in <paramref name="text"/>.</param>
        /// <returns><c>true</c> if <paramref name="pos"/> is a word break
        /// in <paramref name="text"/>, otherwise false.</returns>
        public static bool SimpleWordBreak(this string text, int pos)
        {
            return (pos <= 0 || pos >= text.Length) ||
                (text.IsWordCharacter(pos - 1) ^ text.IsWordCharacter(pos));
        }

        enum WordBreak : byte
        {
            ALetter, MidLetter, MidNumber, MidNumLet, HebrewLetter, Katakana, RegionInd,
            Numeric, Connector, DoubleQuote, SingleQuote, Newline, Extend, Format, Other
        };

        static WordBreak GetWordBreakInfo(this string text, int pos)
        {
            int point = text.ToCodepoint(pos);
            if (point == int.MaxValue)
                return WordBreak.Other;
            else
                return (WordBreak)WORD_BREAK_INDEX[point];
        }

