                    text.PrevCodepoint(ref i);
                    back1 = text.GetWordBreakInfo(i);
                }
                do
                {
                    text.PrevCodepoint(ref i);
                    back2 = text.GetWordBreakInfo(i);
                } while (back2 == WordBreak.Extend || back2 == WordBreak.Format);

                i = pos;
                do
                {
                    text.NextCodepoint(ref i);
