                            default: return true;
                        }
                    case WordBreak.HebrewLetter: switch (next1)
                        {
                            case WordBreak.ALetter:
                            case WordBreak.HebrewLetter:
                            case WordBreak.Numeric:
                            case WordBreak.Connector:
                            case WordBreak.SingleQuote: return false;

                            case WordBreak.MidLetter:
                            case WordBreak.MidNumLet:
                                return !(next2 == WordBreak.ALetter || next2 == WordBreak.HebrewLetter);

                            case WordBreak.DoubleQuote: return next2 != WordBreak.HebrewLetter;

                            default: return true;
                        }
                    case WordBreak.MidLetter: switch (next1)
                        {
                            case WordBreak.ALetter:
                            case WordBreak.HebrewLetter:
