                            default: return true;
                        }
                    case WordBreak.DoubleQuote:
                        return !(back2 == WordBreak.HebrewLetter && next1 == WordBreak.HebrewLetter);

                    case WordBreak.Numeric: switch (next1)
                        {
                            case WordBreak.ALetter:
                            case WordBreak.HebrewLetter:
                            case WordBreak.Numeric:
                            case WordBreak.Connector: return false;
                            case WordBreak.MidNumber:
                            case WordBreak.MidNumLet:
                            case WordBreak.SingleQuote: return next2 != WordBreak.Numeric;
                            default: return true;
                        }
                    case WordBreak.Katakana: switch (next1)
